  TYPE TB_CURSOR IS TABLE OF C01%ROWTYPE INDEX BY PLS_INTEGER;
  TB_C01 TB_CURSOR;
  
BEGIN
  OPEN C01;
  LOOP
    FETCH C01 BULK COLLECT INTO TB_C01;
    FORALL I IN TB_C01.FIRST .. TB_C01.LAST
        UPDATE CECRED.CRAPSNH
           SET VLLIMTED = TB_C01(I).PROPOSTA
         WHERE CDCOOPER = TB_C01(I).CDCOOPER
           AND TPDSENHA = 1
           AND NRDCONTA = TB_C01(I).NRDCONTA
           AND IDSEQTTL = TB_C01(I).IDSEQTTL;
    COMMIT;
    EXIT;
  END LOOP;
  CLOSE C01;
END;
